INSERT INTO `NOTICIA` VALUES (18,'Acesso de estudantes à UNREAL game ENGINEE','<b>Notícia</b>',NULL,1,'0000-00-00 00:00:00'),(24,'Concurso UERJ','<p>Concurso para uma vaga no departamento de informática e ciência da computação da Uerj destinada à área de computação<br> gráfica - especialidades visão computacional, análise e processamento de imagem.</p><div class=\"text_exposed_show\"><p> Em nossa universidade, o vencimento base no regime de 40h é de R$ 5.497,00,<br> mas caso opte por ingressar no regime trabalho de dedicação exclusiva o<br> salário bruto vai a  R$ 9.070,00. Além disso, professores com bom nível de<br> produção podem concorrer a uma bolsa de R$ 4.000,00 mensais sem incidência<br> de imposto através do programa prociência.</p><p> As inscrições serão realizadas no período de *05/01/2015 a 16/01/2015 e de<br> 21/01/2015 a 11/02/2015*, no Instituto de Matemática e Estatística da UERJ,<br> situado na Rua São Francisco Xavier, nº 524, pavilhão João Lyra Filho, 6º<br> andar, bloco B, sala 6019, Maracanã, cidade do Rio de Janeiro, telefones<br> (21) 2334-0144 / 2334-0344, das 10 horas às 16 horas.</p><p> Maiores informações podem ser obtidas no edital:<br> <a href=\"http://srh.uerj.br/docente/Arquivos/concurso1113/ED_ADJ_COMPUTA%C3%87%C3%83O%20GR%C3%81FICA.doc\" target=\"_blank\" rel=\"nofollow\">http://srh.uerj.br/…/ED_ADJ_COMPUTA%C3%87%C3%83O%20GR%C3%81…</a></p><p> Em caso de dúvida, fique a vontade para me contactar através dos e-mails<br> guimota@ime.uerj.br e guimota@gmail.com</p></div>','',1,'2015-03-31 13:56:44'),(26,'Nova Noticia','asdasdassssssssssssssssssssssssssssssssssssssssssssss','http://placehold.it/700x300/81326D/ffffff&text=Notícia',1,'2015-03-29 01:11:26');
